import React from 'react';
import { useHistory } from 'react-router-dom';

function MenuBar() {
  const history = useHistory();

  // Función para manejar la selección de la opción del menú
  const handleMenuClick = (option) => {
    // Redirigir al componente VehicleForm
    history.push('/vehicle-form');
  };

  return (
    <div style={{ backgroundColor: '#333', color: '#fff', padding: '10px 0' }}>
      <ul style={{ listStyle: 'none', margin: 0, padding: 0, display: 'flex', marginLeft: 10 }}>
        <li style={{ marginRight: '20px', cursor: 'pointer' }} onClick={() => handleMenuClick('Alta')}>Alta</li>
      </ul>
    </div>
  );
}

export default MenuBar;
